func randInt(bound int) int {
	n, _ := rand.Int(rand.Reader, big.NewInt(int64(bound)))
	return int(n.Int64())
}

func randText() string {
	start := randInt(randomTextLen - maxCommentLen)
	end := randInt(maxCommentLen)
	return randomText[start:start+end]
}

func reviewerIds(revs map[string]string) []string {
	ret := make([]string, len(revs))
	i := 0
	for id, _ := range revs {
		ret[i] = id
		i = i + 1
	}
	return ret
}

